import React from "react";
import ReactDOM from "react-dom";
import App from "./components/App";

const cuurrentdate = new Date();
const year = cuurrentdate.getFullYear();
const cuurrentTime = cuurrentdate.getHours();
ReactDOM.render(
    <div>
        <App />
        <p>{`${cuurrentdate} ${year} ${cuurrentTime}`}</p>
        <p>{year}</p>
        <p>{cuurrentTime}</p>
    </div>
    , document.getElementById("root"));

var numbers = [3, 5, 3, 45, 2];

const newnumbers = numbers.findIndex(num => num * 10);

console.log(newnumbers);
